            const rand = Math.random()
            console.log('random num',rand);

            if (rand >= 0.5) {
                res ('promesa satisfecha')
            } else {
                rej ('rechazadaaaaa')
            }

        })
        promesa.then((result) => {
            console.log("la promesa fue satisfehca",result);

        }).catch ((result) => {
            console.log("la promesa fue rechazada",result);

        })
    }, [])
    
  return (
